import React from 'react';
import { useParams } from "react-router-dom";
import { recipies } from './CentreDisplay';

function RecipiePage(props) {
    const { recipieName } = useParams();

    const currentRecipie = recipies.filter(recipie => {
        return recipie.title === recipieName
    })

    return (
        <div>
        <h1>Dummy</h1>
        <h1>{currentRecipie[0].title} </h1>
        </div>
    )
}

export default RecipiePage;
